  return (
    <Card>
        <CardHeader title='Income'  />
        <CardContent>
            <Typography variant='h5'>$50</Typography>
            <Doughnut data='DATA'  />
        </CardContent>
        j,jjgh
    </Card>
  );
}

export default Details;
